import React from 'react';
import logo from './logos/MyMixer.png';
import MixerLogo from './MixerLogo/MixerLogo'

const NavBar= () =>{
  return (
    <nav class="navbar navbar-expand-rg navbar-light bg-light">
    <div></div>
    <ul class="navbar-nav justify-content-center">
      <a class="navbar-brand mr-sm-0" m href="">
        <img src={logo}/>
      </a>
    </ul>
    <ul class="navbar-nav justify-content-end">
        <li class="nav-item">
          <a class="nav-link" href="essentials">Essentials</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="faq">FAQ</a>
        </li>
    </ul>
    </nav>
  )
};
export default NavBar;
